                                         title: 'MicroScopic Diagnosis',
                                         information: 'This section may be called microscopic diagnosis or just diagnosis. This is the meat of the report, but we need to understand a bit about the colon in order to understand this part of the report. The colon, or large intestine, is a tube that is about 5 to 6 feet in length; the first 5 feet make up the colon, which then connects to about 6 inches of rectum, and finally ends with the anus. The colon is made up of several sections and your report may specify which section the tumor was located in. These sections are called the cecum, ascending, transverse, descending and sigmoid colons, rectum and anus.The splenic and hepatic flexures are areas where the colon bends (or flexes) that are named for the organs they are located near.<br />The colon, which is shaped like a tube, is made up of several layers, starting with the innermost layer, the mucosa (which is made up of epithrlium). and then the lamina propria and muscularis mucosa. This is surrounded by the submucosa, which is surrounded by two layers of muscle (or muscularis), and finally, the sarosa layer, which is the outside layer of the tube. The outside of the colon is covered adipose tissue, which contains lymph nodes and blood vessels which feed the colon tissue.<br />The rest of the sections indicate the individual sections of the report and how to interpret them.',
