                                         information: 'The type of colon tumor describes the cells from which the tumor arises.<br/>Adenocarcinoma is the most common type, accounting for 95-98% of colon cancers. An adenocarcinoma arises from the glandular cells that line the inside of the colon. Two subtypes of adenocarcinoma are signet ring and mucinous, which are both named for the way the cells look under the microscope.<br/>The other 2-5% of cancers found in the colon are lymphomas, GIST, and carcinoid tumors.<br/> If a polyp was removed, this section will describe the type of polyp. A colon polyp is a benign growth that, over time, can turn into cancer. For that reason, they are removed during a colonoscopy and may be sent to the pathologist to determine what type of polyp it is. There are several types of polyps that can be found in the colon:<br/> Tubular adenoma (also called adenomatous polyp): this accounts for 70% of the polyps found in the colon and can progress into cancer, but this happens over many years. If they are found early, they can be removed during colonoscopy.<br/> Villous adenoma: this accounts for 15% of the polyps found in the colon. This type of polyp has the highest risk of turning into cancer. In some cases these can be removed during colonoscopy, but in other cases surgery is required.<br/> Hyperplastic polyps and Inflammatory (or pseudopolyps): these two types of polyps are not likely to turn into a cancer.'
