                            "title": "New Lesion",
                            "information": "The appearance of new malignant lesions denotes disease progression; therefore, some comments on detection of new lesions are important.<br/>finding of a new lesion should be unequivocal: i.e. not attributable to differences in scanning technique, change in imaging modality or findings thought to represent something other than tumour (for example, some ‘new’ bone lesions may be simply healing or flare of pre-existing lesions).<br/>A lesion identified on a follow-up study in an anatomical location that was not scanned at baseline is considered a new lesion and will indicate disease progression.<br/>If a new lesion is equivocal, for example because of its small size, continued therapy and follow-up evaluation will clarify if it represents truly new disease. If repeat scans confirm there is definitely a new lesion, then progression should be declared using the date of the initial scan. "
